    			var middle,
    				start = startIndex ? startIndex : 0,
    				end = endIndex ? endIndex : array.length - 1,
    				findValue = Math.floor(value),
    				strandAttrByArray,
    				rangeAttrByArray,
    				middleArray;
    			if (array.length === 0) {
    				return 0;
    			}
